import React from 'react';
import './FileList.css';

function FileList() {
  const files = [
    { id: 1, name: 'File 1.txt', size: '1 KB', date: '2025-11-19' },
    { id: 2, name: 'File 2.jpg', size: '10 KB', date: '2025-11-18' },
    { id: 3, name: 'Folder 1', size: '', date: '2025-11-17' },
  ];

  return (
    <div className="file-list">
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Size</th>
            <th>Date</th>
          </tr>
        </thead>
        <tbody>
          {files.map(file => (
            <tr key={file.id}>
              <td>{file.name}</td>
              <td>{file.size}</td>
              <td>{file.date}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default FileList;
